import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.io.PrintWriter;
import java.util.*;

public class Main {
    static class Graph {
        int n;
        List<List<Integer>> g;
        List<List<Integer>> g2;
        List<List<Integer>> g3;

        public Graph(int n) {
            this.n = n;
            this.g = new ArrayList<>();
            this.g2 = new ArrayList<>();
            this.g3 = new ArrayList<>();
            for (int i = 0; i < n; i++) {
                g.add(new ArrayList<>());
                g2.add(new ArrayList<>());
                g3.add(new ArrayList<>());
            }
        }

        public void addEdge(int u, int v) {
            g.get(u).add(v);
            g2.get(v).add(u);
        }

        public void addEdge2(int u, int v) {
            g2.get(u).add(v);
            g3.get(v).add(u);
        }

        public void addEdge3(int u, int v) {
            g3.get(u).add(v);
        }
    }

    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        PrintWriter pw = new PrintWriter(System.out);
        StringTokenizer st = new StringTokenizer(br.readLine());
        int n = Integer.parseInt(st.nextToken());
        int k = Integer.parseInt(st.nextToken());
        Graph g = new Graph(n);
        String[] s = new String[n];
        for (int i = 0; i < n; i++) {
            s[i] = br.readLine();
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < k; j++) {
                g.addEdge(i, s[i].charAt(j) - 'A');
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < k; j++) {
                g.addEdge2(i, s[i].charAt(j) - 'A');
            }
        }
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < k; j++) {
                g.addEdge3(i, s[i].charAt(j) - 'A');
            }
        }
        boolean[] used = new boolean[n];
        StringBuilder ans = new StringBuilder();
        for (int i = 0; i < n; i++) {
            if (!used[i]) {
                dfs(g, used, ans, i);
            }
        }
        pw.println(ans.toString());
        pw.close();
    }

    public static void dfs(Graph g, boolean[] used, StringBuilder ans, int v) {
        used[v] = true;
        for (int u : g.g3.get(v)) {
            if (!used[u]) {
                dfs(g, used, ans, u);
            }
        }
        ans.append((char) (v + 'A'));
    }
}
